  window.addEventListener('touchstart', function(){}); // fix app active
  var paneArr = [];
  $('.J_pane').each(function() {
    paneArr.push($(this).offset().top);
  });
  paneArr.reverse();
  var winH = $(window).height();
  // console.log('winH', winH);
  // console.log('arr', paneArr);

  var throttle = function(fn, delay, mustRunDelay) { // 函数节流
    var timer = null;
    var t_start;
    return function() {
      var context = this,
        args = arguments,
        t_curr = +new Date();
      clearTimeout(timer);
      if (!t_start) {
        t_start = t_curr;
      }
      if (t_curr - t_start >= mustRunDelay) {
        fn.apply(context, args);
        t_start = t_curr;
      } else {
        timer = setTimeout(function() {
          fn.apply(context, args);
        }, delay);
      }
    };
  };
  $(window).scroll(throttle(function() { // 滚动导航
    var scrollTop = $(window).scrollTop() + winH / 3 * 2;
    // console.log('scrollTop', scrollTop);
    for (var i in paneArr) {
      if (paneArr[i] < scrollTop) {
        // console.log('i', i);
        $('.J_nav').find('.item').eq(3 - i).addClass('current').siblings().removeClass('current');
        return false;
      }
    }
  }, 100, 500));


